import React, { Component } from 'react';

// Internal Routes
import '../App.scss';

const endpoint = 'http://localhost:8080/api/bananas';
const tempList = [
    {
      id: 1,
    name: 'A',
    position:'Sales Directory II',
    location: 'Austin'
  },
  {
    id: 2,
  name: 'B',
  position:'Sales Directory II',
  location: 'Austin'
  },
  {
    id: 3,
  name: 'C',
  position:'Sales Directory II',
  location: 'Austin'
  }
]

class List extends Component {
  constructor(props) {
    super(props);

    props.allEmployees = tempList;
  };



render() {
  return (
    <div className="container">
        <div className="employees">
          {
            this.tempList.length > 0 ? (
              this.tempList.map(product => {
                return (
                  <div>Hi there!</div>
                )
              })
            ) :
            (<h4> There are no employees</h4>)
          }
          </div>
      </div>
    );
  }
}

export default List;
